import { Button } from "@mui/material";
import React from "react";

import styles from "./Header.module.css";

const Header = () => {
  return (
    <div className={styles.pageHeader}>
      <div className="">
        <Button variant="outlined">Sign Out</Button>
      </div>
    </div>
  );
};

export default Header;
